import React, { useState } from "react";
import { data } from "./data";

//  useState array
export const UseStateArray = () => {
  const [people, setPeople] = useState(data);
  return (
    <div className="mt-space">
      {people.map((person) => {
        const { id, name } = person;
        return (
          <div key={id}>
            <h4>{name}</h4>
          </div>
        );
      })}
    </div>
  );
};
